import React from "react";
import {
  Container,
  Navbar as NavbarComp,
  Nav,
  NavDropdown,
} from "react-bootstrap";
import { Link } from "react-router-dom";
import booksLogo from "../../assets/books-logo.png";
import cartIcon from "../../assets/cart-icon.png";
import blankProfile from "../../assets/blank-profile.png"

function NavbarUser(props) {
  return (
    <NavbarComp expand="lg">
      <Container>
        <NavbarComp.Brand as={Link} to="/">
          <img
            src={booksLogo}
            className="img-fluid"
            style={{ width: "60px", height: "60px" }}
            alt="brand"
          />
        </NavbarComp.Brand>

        <NavbarComp.Toggle aria-controls="basic-navbar-nav" />
        <NavbarComp.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <Nav.Link
              as={Link}
              to="/cart"
              className={
                props?.title === "Cart" ? `text-navbar-active` : `text-navbar`
              }
            >
              <img src={cartIcon} alt="cart"></img>
            </Nav.Link>

            <NavDropdown eventKey={1} 
                title={
                    <div className="ms-auto text-end ">
                        <img className="h-10 rounded-circle img-fluid" 
                            src={blankProfile} 
                            alt="user pic"
                        />

                        User
                    </div>
                } 
                >


              <Nav.Link
                as={Link}
                to="/profile"
                className={
                  props?.title === "Profile"
                    ? `text-navbar-active`
                    : `text-navbar`
                }
              >
                Profile
              </Nav.Link>
              <Nav.Link
                as={Link}
                to="/complain"
                className={
                  props?.title === "Complain"
                    ? `text-navbar-active`
                    : `text-navbar`
                }
              >
                ComplainAdmin
              </Nav.Link>
              <Nav.Link onClick="" className="text-navbar">
                Logout
              </Nav.Link>
            </NavDropdown>
          </Nav>
        </NavbarComp.Collapse>
      </Container>
    </NavbarComp>
  );
}

export default NavbarUser;
